   FROM (((((((((((((((public.event e
     JOIN ( SELECT c.event,
            string_agg(concat((c.day)::text, ','::text, (c.start_time)::text, ','::text, (c.end_time)::text), ';'::text) AS open_time
           FROM public.calendar c
