     JOIN public.a_event_category_event_category ec ON (((ec.event)::text = (e.classid)::text)))
     JOIN public.event_category cat ON (((cat.classid)::text = (ec.category)::text)))
     LEFT JOIN public.event_category_name_trad_t ec_en ON ((((ec_en.classref)::text = (cat.classid)::text) AND ((ec_en.name_trad_lang)::text = 'en'::text))))
     LEFT JOIN public.event_category_name_trad_t ec_de ON ((((ec_de.classref)::text = (cat.classid)::text) AND ((ec_de.name_trad_lang)::text = 'de'::text))))
