     LEFT JOIN public.event_name_trad_t et_de ON ((((et_de.classref)::text = (e.classid)::text) AND ((et_de.name_trad_lang)::text = 'de'::text))))
     LEFT JOIN public.event_name_trad_t et_fr ON ((((et_fr.classref)::text = (e.classid)::text) AND ((et_fr.name_trad_lang)::text = 'fr'::text))))
     LEFT JOIN public.event_name_trad_t et_es ON ((((et_es.classref)::text = (e.classid)::text) AND ((et_es.name_trad_lang)::text = 'es'::text))))
     LEFT JOIN public.event_descr_trad_t dt_en ON ((((dt_en.classref)::text = (e.classid)::text) AND ((dt_en.descr_trad_lang)::text = 'en'::text))))
     LEFT JOIN public.event_descr_trad_t dt_de ON ((((dt_de.classref)::text = (e.classid)::text) AND ((dt_de.descr_trad_lang)::text = 'de'::text))))
     LEFT JOIN public.event_descr_trad_t dt_fr ON ((((dt_fr.classref)::text = (e.classid)::text) AND ((dt_fr.descr_trad_lang)::text = 'fr'::text))))
     LEFT JOIN public.event_descr_trad_t dt_es ON ((((dt_es.classref)::text = (e.classid)::text) AND ((dt_es.descr_trad_lang)::text = 'es'::text))))
  WHERE ((e.state)::text = '01'::text)
