             LEFT JOIN public.art_name_trad_t at_es ON ((((at_es.classref)::text = (a.classid)::text) AND ((at_es.name_trad_lang)::text = 'es'::text))))
             LEFT JOIN public.tour_name_trad_t tt_en ON ((((tt_en.classref)::text = (t.classid)::text) AND ((tt_en.name_trad_lang)::text = 'en'::text))))
             LEFT JOIN public.tour_name_trad_t tt_de ON ((((tt_de.classref)::text = (t.classid)::text) AND ((tt_de.name_trad_lang)::text = 'de'::text))))
             LEFT JOIN public.tour_name_trad_t tt_fr ON ((((tt_fr.classref)::text = (t.classid)::text) AND ((tt_fr.name_trad_lang)::text = 'fr'::text))))
             LEFT JOIN public.tour_name_trad_t tt_es ON ((((tt_es.classref)::text = (t.classid)::text) AND ((tt_es.name_trad_lang)::text = 'es'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_en ON ((((ttd_en.classref)::text = (t.classid)::text) AND ((ttd_en.descr_trad_lang)::text = 'en'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_de ON ((((ttd_de.classref)::text = (t.classid)::text) AND ((ttd_de.descr_trad_lang)::text = 'de'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_fr ON ((((ttd_fr.classref)::text = (t.classid)::text) AND ((ttd_fr.descr_trad_lang)::text = 'fr'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_es ON ((((ttd_es.classref)::text = (t.classid)::text) AND ((ttd_es.descr_trad_lang)::text = 'es'::text))))
          WHERE ((a.state)::text = '01'::text)
          ORDER BY t.classid, at.num) tord
  GROUP BY classid, type, name_it, descr_it, image_url, kml_path, geom_path, proximity_area, duration, max_altitude, elevation_difference, length, filename, name_en, name_de, name_fr, name_es, descr_en, descr_de, descr_fr, descr_es;


ALTER VIEW public.v_tour OWNER TO tourism;

--
-- Name: v_tour2d; Type: VIEW; Schema: public; Owner: tourism
--

CREATE VIEW public.v_tour2d AS
 SELECT classid,
    type,
    name_it,
    descr_it,
    image_url,
    kml_path,
    geom_path,
    proximity_area,
    duration,
    length,
    name_en,
    name_de,
    name_fr,
    name_es,
    descr_en,
    descr_de,
    descr_fr,
    descr_es,
    string_agg((point_of_interest)::text, ','::text) AS points_tour_id,
    string_agg((art_name_it)::text, ','::text) AS points_tour_name_it,
    string_agg((art_name_en)::text, ','::text) AS points_tour_name_en,
    string_agg((art_name_de)::text, ','::text) AS points_tour_name_de,
    string_agg((art_name_fr)::text, ','::text) AS points_tour_name_fr,
    string_agg((art_name_es)::text, ','::text) AS points_tour_name_es,
    string_agg(public.st_astext(geom), ','::text) AS points_geom
   FROM ( SELECT t.classid,
            t.descr_it,
            t.image_url,
            t.kml_path,
            t.name_it,
            public.st_force2d(t.geom_path) AS geom_path,
            t.proximity_area,
            t.duration,
            t.length,
            t.type,
            tt_en.name_trad_value AS name_en,
            tt_de.name_trad_value AS name_de,
            tt_fr.name_trad_value AS name_fr,
            tt_es.name_trad_value AS name_es,
            ttd_en.descr_trad_value AS descr_en,
            ttd_de.descr_trad_value AS descr_de,
            ttd_fr.descr_trad_value AS descr_fr,
            ttd_es.descr_trad_value AS descr_es,
            at.num,
            at.point_of_interest,
            a.name_it AS art_name_it,
            at_en.name_trad_value AS art_name_en,
            at_de.name_trad_value AS art_name_de,
            at_fr.name_trad_value AS art_name_fr,
            at_es.name_trad_value AS art_name_es,
            la.geom
           FROM (((((((((((((((public.tour t
             JOIN public.a_art_tour_tour at ON (((t.classid)::text = (at.tour)::text)))
             JOIN public.art a ON (((a.classid)::text = (at.point_of_interest)::text)))
             JOIN ( SELECT l.event,
                    min((l.geom)::text) AS geom
                   FROM public.location l
                  GROUP BY l.event) la ON (((la.event)::text = (a.classid)::text)))
             LEFT JOIN public.art_name_trad_t at_en ON ((((at_en.classref)::text = (a.classid)::text) AND ((at_en.name_trad_lang)::text = 'en'::text))))
             LEFT JOIN public.art_name_trad_t at_de ON ((((at_de.classref)::text = (a.classid)::text) AND ((at_de.name_trad_lang)::text = 'de'::text))))
             LEFT JOIN public.art_name_trad_t at_fr ON ((((at_fr.classref)::text = (a.classid)::text) AND ((at_fr.name_trad_lang)::text = 'fr'::text))))
             LEFT JOIN public.art_name_trad_t at_es ON ((((at_es.classref)::text = (a.classid)::text) AND ((at_es.name_trad_lang)::text = 'es'::text))))
             LEFT JOIN public.tour_name_trad_t tt_en ON ((((tt_en.classref)::text = (t.classid)::text) AND ((tt_en.name_trad_lang)::text = 'en'::text))))
             LEFT JOIN public.tour_name_trad_t tt_de ON ((((tt_de.classref)::text = (t.classid)::text) AND ((tt_de.name_trad_lang)::text = 'de'::text))))
             LEFT JOIN public.tour_name_trad_t tt_fr ON ((((tt_fr.classref)::text = (t.classid)::text) AND ((tt_fr.name_trad_lang)::text = 'fr'::text))))
             LEFT JOIN public.tour_name_trad_t tt_es ON ((((tt_es.classref)::text = (t.classid)::text) AND ((tt_es.name_trad_lang)::text = 'es'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_en ON ((((ttd_en.classref)::text = (t.classid)::text) AND ((ttd_en.descr_trad_lang)::text = 'en'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_de ON ((((ttd_de.classref)::text = (t.classid)::text) AND ((ttd_de.descr_trad_lang)::text = 'de'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_fr ON ((((ttd_fr.classref)::text = (t.classid)::text) AND ((ttd_fr.descr_trad_lang)::text = 'fr'::text))))
             LEFT JOIN public.tour_descr_trad_t ttd_es ON ((((ttd_es.classref)::text = (t.classid)::text) AND ((ttd_es.descr_trad_lang)::text = 'es'::text))))
          WHERE ((a.state)::text = '01'::text)
          ORDER BY t.classid, at.num) tord
  GROUP BY classid, type, name_it, descr_it, image_url, kml_path, geom_path, proximity_area, duration, length, name_en, name_de, name_fr, name_es, descr_en, descr_de, descr_fr, descr_es;


ALTER VIEW public.v_tour2d OWNER TO tourism;

--
-- Name: v_tour_media; Type: VIEW; Schema: public; Owner: tourism
--

CREATE VIEW public.v_tour_media AS
 SELECT ((t.classid)::text || 'MAIN'::text) AS classid,
    t.image_url AS path,
    t.classid AS tour,
    t.name_it AS name_art_it,
    tt_en.name_trad_value AS name_art_en,
    tt_de.name_trad_value AS name_art_de,
    tt_fr.name_trad_value AS name_art_fr,
    tt_es.name_trad_value AS name_art_es
   FROM ((((public.tour t
     LEFT JOIN public.tour_name_trad_t tt_en ON ((((tt_en.classref)::text = (t.classid)::text) AND ((tt_en.name_trad_lang)::text = 'en'::text))))
     LEFT JOIN public.tour_name_trad_t tt_de ON ((((tt_de.classref)::text = (t.classid)::text) AND ((tt_de.name_trad_lang)::text = 'de'::text))))
     LEFT JOIN public.tour_name_trad_t tt_fr ON ((((tt_fr.classref)::text = (t.classid)::text) AND ((tt_fr.name_trad_lang)::text = 'fr'::text))))
     LEFT JOIN public.tour_name_trad_t tt_es ON ((((tt_es.classref)::text = (t.classid)::text) AND ((tt_es.name_trad_lang)::text = 'es'::text))))
  WHERE (((t.state)::text = '01'::text) AND (t.image_url IS NOT NULL) AND ((t.image_url)::text <> ''::text))
UNION
 SELECT mt.classid,
    mt.path,
    mt.tour,
    t.name_it AS name_art_it,
    tt_en.name_trad_value AS name_art_en,
    tt_de.name_trad_value AS name_art_de,
    tt_fr.name_trad_value AS name_art_fr,
    tt_es.name_trad_value AS name_art_es
   FROM (((((public.tour_media mt
     JOIN public.tour t ON (((mt.tour)::text = (t.classid)::text)))
     LEFT JOIN public.tour_name_trad_t tt_en ON ((((tt_en.classref)::text = (t.classid)::text) AND ((tt_en.name_trad_lang)::text = 'en'::text))))
     LEFT JOIN public.tour_name_trad_t tt_de ON ((((tt_de.classref)::text = (t.classid)::text) AND ((tt_de.name_trad_lang)::text = 'de'::text))))
     LEFT JOIN public.tour_name_trad_t tt_fr ON ((((tt_fr.classref)::text = (t.classid)::text) AND ((tt_fr.name_trad_lang)::text = 'fr'::text))))
     LEFT JOIN public.tour_name_trad_t tt_es ON ((((tt_es.classref)::text = (t.classid)::text) AND ((tt_es.name_trad_lang)::text = 'es'::text))))
  WHERE ((t.state)::text = '01'::text);


