INSERT INTO oldapp.art VALUES (43, '2015-03-17 23:51:55.703171', NULL, 'monumento storico', 'Arco dei Gavi', 'Sul lato destro di Castelvecchio, in una piccola area verde affacciata sull’Adige, si erge questa costruzione del I sec. d.C., dell’architetto romano Lucio Vitruvio Cerdone. La firma dell’autore sul monumento, fenomeno molto raro in età classica, è uno degli aspetti che hanno reso famoso l’arco che fu costruito per celebrare una delle famiglie più importanti della Verona romana, la gens Gavia.\n
In origine era posto sulla via Postumia, poco distante dall’attuale torre dell’Orologio di Castelvecchio (la collocazione originaria è riconoscibile per la segnalazione, sul selciato, della posizione delle basi dei pilastri). Nel Medioevo l’arco, compreso tra le mura scaligere e la Torre, fu usato come porta urbica. Nel ‘500 vi furono addossate delle costruzioni e vi si insediarono alcune botteghe.\n
Nel 1805, durante l’occupazione napoleonica, i francesi ne decisero la demolizione, perché ritenevano l’arco d’intralcio al traffico (soprattutto militare). Le pietre del monumento vennero prima spostate in piazza Cittadella, poi vennero trasferite presso l’Arena. Fu ricomposto nel 1932 con i blocchi originali.\n
In calcare bianco locale, presenta una struttura a quattro fronti, i cui due principali erano rivolti verso la via Postumia. L’arco è ad unico fornice incorniciato da colonne corinzie (le cui basi sono decorate con bassorilievi vegetali) e da un timpano triangolare; il soffitto interno è a cassettoni e presenta una testa di Medusa.\n
Nelle nicchie sui frontoni principali si trovavano statue raffiguranti alcuni membri della famiglia dei Gavi, con relative iscrizioni (ora andate perdute). Sotto l’arco è stato posto un tratto di strada romana, in basalto nero, che reca i segni del passaggio di carri.', 'http://www.turismoverona.eu/cache/cfx_imagecr3/0C141E6FE34FA03F46BBA7F6AA4E0A98.jpg', NULL, NULL, NULL, NULL, '0101000020E610000033A48AE255B8464087156EF948FA2540', '', NULL, NULL, NULL);
INSERT INTO oldapp.art VALUES (44, '2015-03-17 23:51:55.722374', NULL, 'monumento storico', 'Porta Borsari', 'Il nome ha origine bassomedievale e deriva dai bursarii che qui, all’epoca, riscuotevano i dazi vescovili. In epoca romana era chiamata Porta Iovia, nome che le veniva dalla presenza di un tempio dedicato a Giove, posto appena fuori della porta (i cui resti sono visibili nei giardini del Cimitero Monumentale).\n
Aperta probabilmente nel I sec. a.C. sulla via Postumia (che nel tratto urbano costituiva il decumano massimo) e rinnovata nel I sec. d.C., era l’ingresso principale della città e la sua funzione di rappresentanza era sottolineata da ricche decorazioni ornamentali.\n
Porta Borsari era un edificio con corte centrale e doppi passaggi nelle facciate.
Di tale costruzione resta solo la facciata esterna in calcare bianco locale, con due fornici inquadrati da edicole e sormontati da due ordini di finestre, sei delle quali incorniciate da fini decorazioni.\n
Sull’architrave sopra i fornici l’imperatore Gallieno fece incidere un’iscrizione che ricordasse la ricostruzione nel 265 d.C. della cinta muraria urbana (in realtà il suo fu un intervento di ripristino e ampliamento, non di ricostruzione).', 'http://www.turismoverona.eu/cache/cfx_imagecr3/F3C43F95CB47FB3D984E8D1E162574E8.JPG', NULL, NULL, NULL, NULL, '0101000020E6100000184339D1AEB84640FC8EE1B19FFD2540', '', NULL, NULL, NULL);
INSERT INTO oldapp.art VALUES (45, '2015-03-17 23:51:55.739113', NULL, 'monumento storico', 'Sito arecheologico degli scavi Scaligeri', 'Verso la fine degli anni settanta, il Comune di Verona iniziò i lavori di restauro del complesso del Palazzo del Capitanio, in Piazza dei Signori. Gli scavi eseguiti in questa occasione hanno portato alla luce numerosi resti archeologici romani e medievali, ora lasciati in vista.\n
L’area interessata è costituita dalla zona del cortile del palazzo, da Via Dante e da una parte del Palazzo della Ragione o del Comune ed è una delle aree archeologiche urbane più estese del Nord Italia.\n
In età romana, la zona era occupata da case più volte ristrutturate, fino al V sec. d.C. Nel secolo successivo le abitazioni vennero abbandonate, dopo un lungo periodo di decadenza urbana (come indicato dal progressivo impoverimento dei materiali edilizi utilizzato per le costruzioni successive al V sec.) e fino al X sec. l’area fu adibita ad orto.\n
Dall’XI sec. nella zona venne impiantato il cimitero della chiesa di S. Maria Antica, abbandonato alla fine del XII sec., quando sull’area ricominciano ad essere costruiti nuovi edifici. Nel XIII sec. Alberto I della Scala si appropria di tutta l’area e vi comincia a edificare i palazzi della famiglia scaligera. Le tracce di queste differenti epoche sono state ritrovate durante le ricerche archeologiche.\n
L’ingresso agli Scavi è situato in Cortile del Tribunale, verso Piazza Viviani. Scesa la scala, il visitatore segue un suggestivo percorso nella storia che non presenta un preciso ordine cronologico in un susseguirsi di testimonianze di epoche diverse.\n
All’epoca romana appartengono un mosaico pavimentale, con motivi geometrici e animali, e i resti di una casa, di edifici pubblici, di una strada lastricata in calcare e di una fognatura a volta in mattoni, della metà del I sec.\n
Risalgono all’epoca medievale due tombe che facevano parte del cimitero di S. Maria Antica, una cantina appartenente al palazzo di Alberto I della Scala (fine XIII sec.), le fondamenta di una casa-torre quadrata, esempi di muratura appartenenti a periodi diversi.\n
Di epoca longobarda è invece una tomba per due individui, rinvenuta con alcuni oggetti di corredo.\n
Questo interessante percorso, restaurato e reso visitabile grazie al lavoro dell’architetto veronese Libero Cecchini è stato adibito nel 1996 dal Comune di Verona a spazio espositivo per iniziative di carattere fotografico.
È così diventato sede del Centro Internazionale di Fotografia Scavi Scaligeri, nato per contribuire alla divulgazione, allo studio e allo sviluppo dell’arte fotografica.', '', NULL, NULL, NULL, NULL, '0101000020E610000008910C39B6B846406283859334FF2540', '', 'Contatti:\nCentro internazionale di Fotografia Scavi Scaligeri\n
Cortile del Tribunale (Piazza Viviani)\n tel. + 39 0458007490\n
mail: scaviscaligeri@comune.verona.it', 'Sito visitabile solo in occasione delle mostre fotografiche: mar-dom 10.00-19.00 \n Chiuso il lunedì', 'intero €5,00 - ridotto €3,00\ngruppi (min 15 pax) €3,00 - scolaresche e bambini 8-14 anni €1,00 - 0-7 anni gratuito\n
Gratuito con Verona Card');
INSERT INTO oldapp.art VALUES (46, '2015-03-17 23:51:55.75572', NULL, 'monumento storico', 'Ponte Pietra', 'Costruito a cavallo dell’Adige dove fin dalla preistoria esisteva un guado tra il colle di S. Pietro e la pianura, la mancanza dell’allineamento con il reticolo viario urbano romano ha fatto pensare ad una realizzazione del ponte precedente all’89 a.C.  
Nei secoli ha subito numerosi crolli, ricostruzioni e restauri.  Gli interventi più importanti furono quello del II sec. d.C. che portò all’inserimento di blocchi di marmo; quello del 1298 che lo dotò delle torri in testa al ponte (una distrutta nel 1801); quello del 1520 di fra’ Giocondo; quello del 1957-59, quando il ponte venne completamente ricostruito per anastilosi perché i tedeschi in ritirata, nel 1945, l’avevano fatto esplodere.', 'http://www.turismoverona.eu/cache/cfx_imagecr3/000BAE77E639A83825EEC1E920AB9EF3.jpg', NULL, NULL, NULL, NULL, '0101000020E6100000A80183A44FB94640D064FF3C0D002640', '', NULL, NULL, NULL);
INSERT INTO oldapp.art VALUES (47, '2015-03-17 23:51:55.772386', NULL, 'monumento storico', 'Teatro Romano', 'Il teatro fu costruito sulle pendici del colle di San Pietro verso la fine del I sec. a.C., durante il principato di Ottaviano Augusto.  
La costruzione, di spettacolare grandiosità, si estendeva dalla riva sinistra dell’Adige alla sommità del colle, ed era in rapporto scenografico con l’impianto urbanistico romano, posto sulla riva destra del fiume.', 'http://www.turismoverona.eu/cache/cfx_imagecr3/0303258CA7F28412EE20F75BC8BD920A.jpg', NULL, NULL, NULL, NULL, '0101000020E6100000A1A2EA573AB946405FD1ADD7F4002640', '', 'Teatro chiuso per restauro', NULL, NULL);
INSERT INTO oldapp.art VALUES (48, '2015-03-17 23:51:55.789089', NULL, 'monumento storico', 'Porta Leoni', 'Posta sul cardo massimo della città romana, è chiamata con questo nome dal XV sec., per la presenza nelle vicinanze di un sarcofago romano in pietra con due leoni (ora posto dietro al monumento ad Umberto I).
La porta era alta 13 metri (quanto le mura cittadine), aveva pianta quadrata e una corte interna, doppie fornici sulle facciate e gallerie nei piani superiori. Gli angoli del fronte esterno erano fiancheggiati da due torri poligonali di raccordo alle mura. Sulle torri e sulle gallerie si aprivano numerose finestre.', 'http://www.turismoverona.eu/cache/cfx_imagecr3/737345A15315A821B62D39217BDDFD6C.jpg', NULL, NULL, NULL, NULL, '0101000020E61000006075E44867B84640CDE67118CCFF2540', '', NULL, NULL, NULL);
INSERT INTO oldapp.art VALUES (49, '2015-03-17 23:51:55.805771', NULL, 'monumento storico', 'Anfiteatro Arena', 'Costruito presumibilmente nella I metà del I secolo d.C., è il monumento più famoso di Verona ed una tappa obbligata per chi visita questa città. E’ il quarto anfiteatro dopo il Colosseo di Roma, quello di Capua e quello di Milano e, come tutte le costruzioni adibite a spettacoli di lotte tra gladiatori e cacce ad animali feroci ed esotici, è formato da una zona centrale con sabbia (da qui la origine del nome del complesso) ed una parte che circonda la prima, formata da una cavea a gradinate di larghezza costante.', 'http://www.turismoverona.eu/cache/cfx_imagecr3/9792742F7CE0EB5A2B4B3E940E2148F4.JPG', NULL, NULL, NULL, NULL, '0101000020E61000003E93FDF334B846406B7EFCA545FD2540', '', 'Contatti:\n
piazza Bra\n
tel. +39 045 8003204\n
info: castelvecchio@comune.verona.it', 'mar-dom 8.30 - 19.30 (la biglietteria chiude alle 18.30)\n
lun. 13.30 - 19.30 (la biglietteria chiude alle 18.30)', 'Dal 2 febbraio 2015 intero €10,00 - ridotto €7,50\n
gruppi (min 15 pax) €7,50 - scolaresche e bambini 8-14 anni €1,00\n 
0-7 anni gratuito\n
