INSERT INTO oldapp.tour VALUES (3, 'Verona romana', 'Passeggiamo in compagnia di Gavia Maxima, rappresentante di una delle famiglie più ricche ed autorevoli della Verona romana, quella della gens Gavia, percorrendo con lei l’ordinato reticolo ortogonale di strade che caratterizza la città.\n Vogliamo immaginare di essere nell’avanzato I secolo d.C., quando Verona è uno dei più importanti centri dell’Italia settentrionale, ben collegato alla rete stradale e, soprattutto, reso elegante ed imponente da un programma edilizio di ampio respiro, di cui restano ancor oggi visibili le vestigia.', NULL, NULL, NULL, NULL, '', ' <kml xmlns="http://www.opengis.net/kml/2.2" xmlns:gx="http://www.google.com/kml/ext/2.2" xmlns:kml="http://www.opengis.net/kml/2.2" xmlns:atom="http://www.w3.org/2005/Atom"> <Document> <name>Itinerario Verona Romana</name> <Style id="icon-ci-1"> <IconStyle> <scale>1.1</scale> <Icon> <href>icon-1.png</href> </Icon> </IconStyle> </Style> <Style id="icon-ci-2"> <IconStyle> <scale>1.1</scale> <Icon> <href>icon-2.png</href> </Icon> </IconStyle> </Style> <Style id="line-1267FF-5"> <LineStyle> <color>ffff6712</color> <width>5</width> </LineStyle> </Style> <Placemark> <name>Da Arco di Gavi a Anfiteatro Arena</name> <styleUrl>#line-1267FF-5</styleUrl> <ExtendedData> </ExtendedData> <LineString> <tessellate>1</tessellate> <coordinates> 10.98878,45.44038,0 10.98924,45.43991,0 10.98935,45.43997,0 10.98978,45.44018,0 10.99019,45.44035000000001,0 10.99075,45.44063000000001,0 10.99079,45.44065,0 10.99105,45.44076,0 10.99184,45.44117,0 10.99197,45.44123,0 10.99268,45.44163,0 10.99297,45.44173,0 10.99312,45.44181,0 10.99321,45.44189,0 10.99368,45.44209,0 10.99391,45.44221000000001,0 10.99443,45.44245,0 10.99481,45.44264,0 10.99536,45.44291,0 10.99554,45.44301,0 10.99573,45.44310999999999,0 10.99506,45.44373,0 10.9955,45.44396,0 10.99582,45.4441,0 10.99594,45.44417,0 10.9963,45.44437,0 10.99683,45.44465,0 10.997,45.44446,0 10.99716,45.44424999999999,0 10.99742,45.44393,0