INSERT INTO public.tour VALUES ('71924', '<p>Si parte dalla piazza General Cantore, a sinistra troviamo la strada che costeggia il lavatoio dopo circa trecento metri, in prossimit&agrave; di un tornante, si deve imboccare il sentiero CAI 674 che ci condurr&agrave; fino a Malga Orsa. Superata la Malga, il sentiero ad un certo punto si biforca e qui si dovr&agrave; tenere la destra. Il sentiero quindi attraversato il ponte tibetano, costegger&agrave; il torrente per qualche centinaio di metri e, ad un certo punto, si collegher&agrave; al sentiero della Speranza proveniente da Brentino. Qui si dovr&agrave; tenere la destra, in direzione del Santuario della Madonna della Corona. Sospeso tra cielo e terra, dal Santuario di origine &lsquo;500 si pu&ograve; avere una straordinaria vista sulla Valdadige. Ritornando sul sentiero, si tiene la sinistra per nella piazzetta di Spiazzi. Quindi imboccando la strada che sale in localit&agrave; Croce, tenendo la sinistra ci indirizziamo sulla strada carrabile che sale sul Monte Croce. Al termine della strada teniamo la destra passando attraverso un sentiero circondati da felci giganti, sbuchiamo nella radura seguendo la traccia sulla destra percorrendo il sentiero che termina sul prato. Teniamo la sinistra e scendiamo in Localit&agrave; Pravazzar entrando sulla strada asfaltata percorriamo circa 400 metri in direzione nord per poi imboccare il primo sentiero che scende sulla destra che ci porta in contrada Castelletti. La attraversiamo per poi imboccare il successivo sentiero che ci porta in centro storico a Ferrara di Monte Baldo attraversando un ponticello sul torrente. Passato il nucleo storico, attraversata la strada verso il parcheggio e scesi verso sud, si torna in piazza General Cantore.</p>', '', NULL, 'Ferrara di M.B./Spiazzi/Ferrara di M.B.', '', NULL, 5, 15.7, 'storico', 1047, 434, '', '01');
INSERT INTO public.tour VALUES ('20355', '<p>Partenza da Novezzina dove si trova l&rsquo;Osservatorio Astronomico Monte Baldo &quot;A.Gelodi&quot;, unico osservatorio pubblico della provincia di Verona, &egrave; di propriet&agrave; del Comune di Ferrara di Monte Baldo ed &egrave; gestito dal Circolo Astrofili Veronesi. Nelle immediate vicinanze c&rsquo;&egrave; il &ldquo;Rifugio&rdquo; a quota 1235 mt. slm e che fino agli anni &lsquo;60 era adibito a vivaio forestale ed ora &egrave; una struttura ricettiva con annesso l&rsquo;orto botanico di circa 20.000 mq. in cui sono visibili alcune centinaia di fiori ed erbe del Monte Baldo, visitabile anche da persone con disabilit&agrave;. Si prosegue sul sentiero verso le malghe Gambon, Prazzagano e Cerbiolo fino ad arrivare al Passo Cerbiolo in confine con il Trentino come delimitato dai cippi di confine del 1754. Girando a sinistra si prosegue sul sentiero delle malghe passando nella zona del &ldquo;Corondoler&rdquo; e si arriva a Passo Campione dove in una vasca viene raccolta l&rsquo;acqua di alcune sorgenti e pompata al serbatoio sul Cavallo di Novezza a quota 1450 mt. che si raggiunge salendo dal Passo Campione. Sul Cavallo di Novezza sono ancora visibili le trincee della 1^ guerra mondiale e scendendo per il pascolo si passa vicino allo Chalet Novezza, la chiesetta di S. Michele fino a giungere al lungo muro di sassi che delimita il confine fra le malghe Novezza e Novezzina. Poco sotto si nota la partenza della teleferica a servizio del Rifugio Telegrafo sul Monte Baldo quindi passando davanti al Rifugio &ldquo;Cedron&rdquo; si torna al punto di partenza.</p>', '', NULL, 'Novezzina/Gambon/Cerbiolo/Novezza', '', NULL, 4.5, 11.6, 'storico', 1426, 241, '', '01');
INSERT INTO public.tour VALUES ('46978', '<p>Partenza dalla piazza Generale A. Cantore a Ferrara di Monte Baldo e, per la strada provinciale costeggiando l&rsquo;albergo del Baldo o per la lunga scalinata di 120 gradini, si sale alla chiesa parrocchiale di S. Caterina V.M.&nbsp;La chiesa di S. Caterina in Ferrara di Montebaldo &egrave; documentata a partire dal 1220.&nbsp;Originariamente cappella soggetta alla pieve di S. Maria in Caprino, nel 1338 fu eretta in Parrocchia.&nbsp;L&rsquo;attuale chiesa parrocchiale &egrave; il risultato dei lavori di ampliamento eseguiti tra il 1870 ed il 1890 su progetto dell&#39;arch.&nbsp;Don Angelo Gottardi. I prospetti interni sono percorsi da una doppia cornice modanata; il settore superiore &egrave; decorato con pitture murali del pittore Rino Saoncella, raffiguranti &ldquo;Storie della vita di Santa Caterina d&rsquo;Alessandria&rdquo; e &ldquo;Santa Caterina d&rsquo;Alessandria in gloria&rdquo;.&nbsp;Proseguendo verso la contrada C&agrave; di Sotto si arriva alla contrada Mezzavilla dove, un po&#39; in disparte, si pu&ograve; vedere l&rsquo;antica fontana&nbsp;lavatoio. Si attraversa la contrada e salendo si arriva alla localit&agrave; Castello e proseguendo si giunge alla &ldquo;Strada Graziani&rdquo; fatta costruire durante la Guerra del 1915-18 dallo stesso Generale Graziani.&nbsp;All&rsquo;incrocio vi &egrave; un capitello&nbsp;costruito nel 1700 e proseguendo si arriva all&rsquo;antico insediamento di Campedello che fu in passato sede comunale prima della stessa Ferrara.&nbsp;Al centro della contrada &egrave; stata costruita negli anni &lsquo;60 una fontana lavatoio.&nbsp;Scendendo si ritrova la strada Graziani, si attraversa e si costeggia la &ldquo;Val dei Coali&rdquo;&nbsp;dove, poco prima del paese, si trova la sorgente ed il serbatoio dell&rsquo;acquedotto comunale. Infine, attraversando il centro storico, si arriva alla piazza di partenza.</p>', 'images/IMG-20230417-WA0026.jpg', NULL, 'Ferrara di M.B./Mezzavilla/Campedello', '', NULL, 1, 4, 'storico', 1056, 243, 'schede/Scheda_F.1_Ferrara_9k366Tk.pdf', '01');


