INSERT INTO public.tour_descr_trad_t VALUES ('20355', 'en', '<p>Departure from Novezzina where the Monte Baldo &quot;A.Gelodi&quot; Astronomical Observatory is located, the only public observatory in the province of Verona, it is owned by the Municipality of Ferrara di Monte Baldo and is managed by the Veronesi Astronomical Club. In the immediate vicinity there is the &quot;Refuge&quot; at an altitude of 1235 meters, above sea level and which until the 1960s was used as a forest nursery and is now an accommodation facility with an adjoining botanical garden of about 20,000 square meters where some hundreds of flowers and herbs from Monte Baldo are visible, which can also be visited by people with disabilities. Continue on the path towards the Gambon, Prazzagano and Cerbiolo huts until you reach Passo Cerbiolo on the border with Trentino as delimited by the border stones of 1754. Turning left, continue on the path of the malghe passing through the &quot;Corondoler&quot; area and arrive at Passo Campione where water from some springs is collected in a tank and pumped to the reservoir on the Cavallo di Novezza at an altitude of 1450 meters which can be reached by climbing from Passo Campione. On the Cavallo di Novezza the trenches of the 1st World War are still visible and going down through the pasture you pass near the Chalet Novezza, the church of S. Michele until you reach the long stone wall that delimits the border between the malghe Novezza and Novezzina. A little below you can see the departure of the cableway serving the Telegrafo Refuge on Monte Baldo, then passing in front of the &ldquo;Cedron&rdquo; Refuge you return to the starting point.</p>', 1);
INSERT INTO public.tour_descr_trad_t VALUES ('71924', 'en', '<p>It starts from the General Cantore square, on the left we find the road that runs alongside the washhouse after about three hundred meters, near a hairpin bend, we must take the CAI 674 path which will lead us to Malga Orsa. After the Malga, the path forks at a certain point and here you have to keep to the right. The path then crosses the Tibetan bridge, runs alongside the stream for a few hundred meters and, at a certain point, connects to the Speranza path coming from Brentino. Here you will have to keep right, in the direction of the Sanctuary of the Madonna della Corona. Suspended between heaven and earth, from the 16th century Sanctuary you can have an extraordinary view of the Valdadige. Returning to the path, keep left into the small square of Spiazzi. Then taking the road that goes up to Croce, keeping to the left we take the driveway that goes up to Monte Croce. At the end of the road we keep to the right passing through a path surrounded by giant ferns, we come out in the clearing following the track on the right along the path that ends on the meadow. We keep to the left and go down to Localit&agrave; Pravazzar entering the paved road we travel about 400 meters in a northerly direction and then take the first path that descends on the right which takes us to the Castelletti district. We cross it and then take the next path that takes us to the historic center of Ferrara di Monte Baldo crossing a small bridge over the stream. After passing the historic nucleus, crossing the road towards the parking lot and heading south, you return to Piazza General Cantore.</p>', 3);
INSERT INTO public.tour_descr_trad_t VALUES ('46978', 'es', '', 4);
INSERT INTO public.tour_descr_trad_t VALUES ('46978', 'en', '<p>Departure from Piazza Generale A. Cantore in Ferrara di Monte Baldo and, along the provincial road alongside the hotel del Baldo or along the long staircase of 120 steps, go up to the parish church of S. Caterina V.M. The church of S. Caterina in Ferrara di Montebaldo is documented starting from 1220. Originally a chapel subject to the parish church of S. Maria in Caprino, in 1338 it was erected as a parish. The current parish church is the result of the expansion works carried out between 1870 and 1890 on a project by the architect Don Angelo Gottardi. The internal elevations are crossed by a double molded frame; the upper sector is decorated with mural paintings by the painter Rino Saoncella, depicting &quot;Stories from the life of Saint Catherine of Alexandria&quot; and &quot;Saint Catherine of Alexandria in glory&quot;. Continuing towards the C&agrave; di Sotto district, you arrive at the Mezzavilla district where, a little apart, you can see the ancient fountain wash house. Cross the district and go up to reach Castello and continue on to the &quot;Strada Graziani&quot; built during the 1915-18 war by General Graziani himself. At the intersection there is a capital built in 1700 and continuing on to the ancient settlement of Campedello which was once the municipal seat before Ferrara itself. In the center of the district a wash-house fountain was built in the 1960s. Going down, you find the Graziani road, cross and skirt the &quot;Val dei Coali&quot; where, just before the town, you will find the source and the reservoir of the municipal aqueduct. Finally, crossing the historic center, you arrive at the starting square.</p>', 2);


